import './App.css';
import Button from './Button';
function App() {
  return (
    <div className="App">
        <Button onClick={() => {
            fetch('http://localhost:8000/api/user', {
                headers: {'Content-Type': 'application/json'},
                credentials: 'include',
            });

            const content = response.json();
            console.log(content)
        }}>Button text</Button>

        <header className="App-header">
      </header>
    </div>
  );
}

export default App;
